import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';
import 'bootstrap/dist/css/bootstrap.rtl.min.css'
import ProductPage from './components/ProductPage';


function App() {
  return (
    <div className="App">
      <Router>

        <Routes>
          <Route path="/" element={<ProductPage/>}/>
        </Routes>

      </Router>
    </div>
  );
}

export default App;
